import React, { Component } from 'react';
import { Container, Form } from 'react-bootstrap';


class Hash extends Component {
    /*
    constructor(props) {
        super(props);
        this.state = {
            data: null,
        };
    }
    */

    render() {
        return (
            <Container>
                <Form onChange={(event) => {
                    event.preventDefault();
                    let d = this.data.value;
                    console.log(d);
                }}>
                    <Form.Group>
                        <Form.Label>
                            Data: 
                        </Form.Label>
                        <Form.Control ref={(input) => this.data = input} type="text" placeholder="" />
                    </Form.Group>

                    <Form.Group>
                        <Form.Label>
                            Hash: 
                        </Form.Label>
                        <Form.Control type="hash" placeholder={d} />
                    </Form.Group>
                </Form>
            </Container>
        );
    }
}

export default Hash;
